webpackJsonp([42072534327829],{5091:function(t,e){t.exports={data:{post:{html:'<p>According to today\'s <a href="http://www.abendblatt.de">Hamburger Abendblatt</a>, every 5th wedding in Hamburg is binational.</p>\n<p>Funny thing about the newspapers in Hamburg... the <a href="http://www.abendblatt.de">Abendblatt</a> is a morning paper, while you can get the <a href="http://www.mopo.de">Morgenpost</a> on the previous evening.</p>\n<p>Breakfast is the hot topic on EditThisPage today. So what did this American living in Germany eat for breakfast this morning? Ahhh, I overslept and ran out of the house without any breakfast at all. However, I did bring along a strawberry yoghurt and picked up a ham <i>Br√∂tchen</i> from the delivery service at work.</p>',fields:{title:"Breakfast of Champions",date:"07 Jun 2000",url:"https://papascott.de/2000-06-07-breakfast-of-champions/"}}},pathContext:{slug:"/2000-06-07-breakfast-of-champions/",prev:{fields:{title:"Stomach Flu",date:"06 Jun 2000",slug:"/2000-06-06-stomach-flu/"}},next:{fields:{title:"Cobblestones",date:"08 Jun 2000",slug:"/2000-06-08-cobblestones/"}}}}}});
